script: |
  super -f text -I q9242.spq | sort > q9242.out

inputs:
  - name: q9242.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 NOT BETWEEN ( col2 * col1 ) AND col1 * - col0 * col0 OR col0 * col0 + col2 * + col0 IN ( + cor0.col0 );
  - name: tab1

outputs:
  - name: q9242.out
    data: |
      3	26	54
      64	10	57
      80	13	96
